// Home.js
import React from "react";
import Car from "./Car";

const Home = ({ carsFiltered, tipCars, handleEdit, handleDelete }) => {
  return (
    <div className="container" style={{ textAlign: "center" }}>
      {/* ... other code ... */}
      <table className="table table-striped">
        <thead>
          <tr>
            <th>Name</th>
            <th>Model</th>
            <th>Tip</th>
            <th>Akcija</th>
          </tr>
        </thead>
        <tbody>
          {carsFiltered.map((car, index) => (
            <Car
              key={index}
              car={car}
              onEdit={handleEdit}
              onDelete={handleDelete}
            />
          ))}
        </tbody>
      </table>
      {/* ... other code ... */}
    </div>
  );
};

export default Home;
